import React from 'react';
import './Footer.css';

function Footer() {
  return (
    <footer id="contact" className="footer">
      <p>Contact us on WhatsApp: <a href="https://wa.me/1234567890">1234567890</a></p>
      <p>Email: info@anusaya.com</p>
      <p>Address: Anusaya Farms, Village XYZ, Maharashtra, India</p>
    </footer>
  );
}

export default Footer;
